otazka12:
Zeleň - rozvoj kontinuálnej starostlivosti, najmä o hodnotné staré stromy;
Blízkosť k rieke - rozvinúť prepojenie s nábrežím; 
Sieť chodníkov - potrebná je výmena povrchov, ideálne bez asfaltu (alebo len v rámci cyklotrás); 
Verejné priestory/mobiliár - tiež by mal byť obnovený;

otazka8:
Nechcem:
- aby sa priestor zastaval/okliestil dalsou vystavbou;
- aby bol prepchaty gastroprevadzkami a inymi komercnymi prevadzkami;
- aby bol zamerany iba na urcitu skupinu ludi, napr rodiny s detmi, cize aby nebol prepchaty detskymi atrakciami a pod.
